import React from 'react';

class FormLogin extends React.Component
{
    render () {
        return (
        // <p> Ini Adalah Statefull Component pada Folder Container </p>
        <div>
        <title>Membuat Desain Form Login Dengan CSS - www.malasngoding.com</title>
        <link rel="stylesheet" type="text/css" href="style.css" />
        <h1>Membuat Desain Form Login Dengan CSS <br /> www.malasngoding.com</h1>
        <div className="kotak_login">
          <p className="tulisan_login">Silahkan login</p>
          <form>
            <label>Username</label>
            <input type="text" name="username" className="form_login" placeholder="Username atau email .." />
            <label>Password</label>
            <input type="text" name="password" className="form_login" placeholder="Password .." />
            <input type="submit" className="tombol_login" defaultValue="LOGIN" />
            <br />
            <br />
            <center>
              <a className="link" href="https://www.malasngoding.com">kembali</a>
            </center>
          </form>
        </div>
      </div>
        );
    }
}

export default FormLogin;
